});
const svgMap = ref(null);
const handleFileUpload = (event) => {
  const file = event.target.files[0];
  if (file) {
    parseCSV(file);
  }
};

const parseCSV = (file) => {
  const reader = new FileReader();
  reader.onload = (event) => {
    const csvData = event.target.result;
    const parsedData = {};

    Papa.parse(csvData, {
      header: true,
      complete: (results) => {
        results.data.forEach((row) => {
          const regionCode = row["Код региона"];
          let color = row["Цвет"];
          switch (color) {
            case "a":
              color = "#cf7474";
              break;
            case "b":
              color = "#f6a481";
              break;
            case "c":
              color = "#ffc84d";
              break;
            case "d":
              color = "#86dfa4";
              break;
            case "e":
              color = "#a4e4f8";
              break;
            default:
              color = undefined;
          }

          parsedData[regionCode] = { fill: color };
        });

        for (const key in parsedData) {
          regionsColors[key] = parsedData[key];
        }
        console.log(regionsColors);
      },
    });
  };
  reader.readAsText(file);
};

function downloadSVG() {
  const svgElement = document.getElementById("svgMap"); // Получаем SVG элемент

  // Создаем XML сериализатор
  const serializer = new XMLSerializer();
  const svgString = serializer.serializeToString(svgElement);

  const blob = new Blob([svgString], { type: "image/svg+xml" }); // Создаем Blob из строкового представления SVG
  const url = URL.createObjectURL(blob); // Создаем URL для Blob

  const link = document.createElement("a");
  link.href = url;
  link.download = "svgMap.svg"; // Указываем имя файла для скачивания
  link.click();

  URL.revokeObjectURL(url); // Освобождаем URL объекта
}

function downloadPNG() {
  const node = document.getElementById("svgMap"); // Получаем SVG элемент

  htmlToImage
    .toPng(node)
    .then(function (dataUrl) {
      var img = new Image();
      img.src = dataUrl;
      const link = document.createElement("a");
      link.href = img.src;
      link.download = "pngMap.png"; // Указываем имя файла для скачивания
      link.click();
    })
    .catch(function (error) {
      console.error("oops, something went wrong!", error);
    });
}
